css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("politico.com") {

/*text&background*/

html, body, tbody, thead, th, tr, td, blockquote, li, ul, h1, h2, h3, h4, h5, h6, p, form, #footer, div#mainContentInner, div#secondaryContent, div#branding, div#searchArea, div#secondaryNav, div#content, .sb-box, div.e-reader-inner

{
color: white !important;
background: black !important;
}

ul#main-nav li a

{
background: black !important;
}

/*links*/

a

{
color: #0040ff !important;
}

/*highlight*/

textarea, pre

{
background: #333333 !important;
}

}
